import React from "react";
import { Loader } from "@googlemaps/js-api-loader";
function resizeIframe(obj) {
  obj.style.height =
    obj.contentWindow.document.documentElement.scrollHeight + "px";
}
const Map = () => {
  return (
    <div>
      <iframe
        style={{ border: 0, width: "100%", height: resizeIframe(this) }}
        // loading="lazy"
        allowFullScreen
        src="https://www.google.com/maps/embed/v1/place?key=AIzaSyD7PLVzeUB1KuZmQYV-kKnEAkdP1wY0iuY&q=Space+Needle,Seattle+WA"
      ></iframe>
    </div>
  );
};

export default Map;
